class App extends Component {
  render () {
    return (
      <div className="App">

        <Navbar />

        <Switch> 
          <Route exact path='/' component={Home} />
          <Route exact path='/phone' component={Phone} />
          <Route exact path='/phone/:id' component={PhoneDetails} />
